import React, { useState, useEffect } from 'react';
import { makeStyles } from '@material-ui/styles';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import {Link} from 'react-router-dom';



const useStyles = makeStyles(theme => ({
  bar: {
    backgroundColor: "#333",
    height: "5vh",
  },
  text: {
    color: "white",
    fontFamily: "Lato",
    fontSize: "0.8em",
    margin: 0
  },
  tabContainer: {
    margin: 0
  },
}))

export default function Footer(props) {
  const classes = useStyles();

  return (
    <React.Fragment>
      <Grid container spacing = {2} alignItems="stretch" justifyContent="center" className={classes.bar}>
        <Grid item xs={4} style={{textAlign: "right", marginTop: "0.5em"}}>
          <Typography className={classes.text} component="p" >Â© Copyright - AC Engineering, Inc. All Rights Reserved | Developed by Edward Briscoe</Typography>
        </Grid>
        <Grid item xs={4} style={{textAlign: "left", marginTop: "0.5em"}}>
          <Typography className={classes.text} component={Link} to="/" style={{ textDecoration: 'none' }}>Home | </Typography>
          <Typography className={classes.text} component={Link} to="/about" style={{ textDecoration: 'none' }}>About Us | </Typography>
          <Typography className={classes.text} component={Link} to="/services" style={{ textDecoration: 'none' }}>Services | </Typography>
          <Typography className={classes.text} component={Link} to="/mobiledatacenters" style={{ textDecoration: 'none' }}>Mobile Data Centers | </Typography>
          <Typography className={classes.text} component={Link} to="/contact" style={{ textDecoration: 'none' }}>Contact Us</Typography>
        </Grid>
      </Grid>
    </React.Fragment>

  )
}
